public class Solution {
    public int minSpeedOnTime(int[] dist, double hour) {
        long left = 1;
        long right = (long) 1e9 + 7;
        while (left < right) {
            long mid = left + (right - left) / 2;
            if (canReachOffice(dist, hour, mid)) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        return left == (long) 1e9 + 7 ? -1 : (int) left;
    }

    private boolean canReachOffice(int[] dist, double hour, long speed) {
        int n = dist.length;
        double time = 0;
        for (int i = 0; i < n - 1; i++) {
            if (speed == 0) return false;
            time += Math.ceil((double) dist[i] / speed);
            speed = 0;
        }
        time += Math.ceil((double) dist[n - 1] / speed);
        return time <= hour;
    }
}

