public class Solution {
    public int getNumberOfBacklogOrders(int[][] orders) {
        PriorityQueue<int[]> buy = new PriorityQueue<>(Comparator.comparingInt(a -> a[0]));
        PriorityQueue<int[]> sell = new PriorityQueue<>(Comparator.comparingInt(a -> a[0]));

        for (int[] order : orders) {
            if (order[2] == 0) { // Buy
                while (!sell.isEmpty() && sell.peek()[0] >= order[0] && order[1] > 0) {
                    int[] s = sell.poll();
                    int min = Math.min(order[1], s[1]);
                    buy.add(new int[]{s[0], s[1] - min});
                    order[1] -= min;
                }
                if (order[1] > 0) {
                    buy.add(order);
                }
            } else { // Sell
                while (!buy.isEmpty() && buy.peek()[0] <= order[0] && order[1] > 0) {
                    int[] b = buy.poll();
                    int min = Math.min(order[1], b[1]);
                    sell.add(new int[]{b[0], b[1] - min});
                    order[1] -= min;
                }
                if (order[1] > 0) {
                    sell.add(order);
                }
            }
        }

        long ans = 0;
        while (!buy.isEmpty()) {
            ans += buy.poll()[1];
        }
        while (!sell.isEmpty()) {
            ans += sell.poll()[1];
        }
        return (int) (ans % (1000000007));
    }
}

