public class Solution {
    public int maxSumMinProduct(int[] nums) {
        long MOD = (long) 1e9 + 7;
        int n = nums.length;
        long[] prefixSums = new long[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSums[i + 1] = prefixSums[i] + nums[i];
        }

        long maxProduct = Long.MIN_VALUE;
        int[] stack = new int[n];
        int top = -1;

        for (int i = 0; i <= n; i++) {
            while (top >= 0 && (i == n || nums[i] > nums[stack[top]])) {
                int j = stack[--top];

                long minVal = nums[j];
                long sum = prefixSums[i] - prefixSums[j];

                while (top >= 0 && stack[top] > j) {
                    minVal = Math.min(minVal, nums[stack[top]]);
                    sum += prefixSums[stack[top]] - prefixSums[j + 1];
                    top--;
                }

                maxProduct = Math.max(maxProduct, minVal * sum);
            }

            if (i < n) {
                stack[++top] = i;
            }
        }

        return (int) (maxProduct % MOD);
    }
}

