public class Solution {
    public int getMinSwaps(String num, int k) {
        char[] chars = num.toCharArray();
        Arrays.sort(chars);
        String sortedNum = new String(chars);

        int n = num.length();
        int[] count = new int[10];
        for (int i = 0; i < n; i++) {
            count[num.charAt(i) - '0']++;
        }

        long[] wonderfulPermutations = getWonderfulPermutations(count);
        Arrays.sort(wonderfulPermutations, Comparator.comparingLong(a -> a));

        int index = binarySearch(sortedNum, wonderfulPermutations, k);

        int minSwaps = 0;
        for (int i = 0; i < n; i++) {
            if (num.charAt(i) != sortedNum.charAt(index)) {
                minSwaps++;
                char temp = num.charAt(i);
                num = swap(num, i, index);
                index--;
                while (index >= 0 && num.charAt(index) == '9') {
                    index--;
                }
                if (index < 0) {
                    break;
                }
            } else {
                index--;
            }
        }

        return minSwaps;
    }

    private long[] getWonderfulPermutations(int[] count) {
        long[] wonderfulPermutations = new long[getFactorial(count[0])];
        int index = 0;

        for (int i = 1; i <= count[0]; i++) {
            if (count[i] > 0) {
                int factorial = getFactorial(i);
                for (long j = 0; j < factorial; j++) {
                    wonderfulPermutations[index++] = j + getFactorial(count[0]) * (j / factorial);
                }
                count[i]--;
            }
        }

        return wonderfulPermutations;
    }

    private int binarySearch(String sortedNum, long[] wonderfulPermutations, int k) {
        int left = 0;
        int right = wonderfulPermutations.length - 1;

        while (left <= right) {
            int mid = left + (right - left) / 2;
            if (compare(sortedNum, wonderfulPermutations[mid]) == 0) {
                return mid;
            } else if (compare(sortedNum, wonderfulPermutations[mid]) < 0) {
                left = mid + 1;
            } else {
                right = mid - 1;
            }
        }

        return left;
    }

    private int compare(String num1, long permutation) {
        String num2 = Long.toString(permutation);
        for (int i = 0; i < num1.length(); i++) {
            if (num1.charAt(i) != num2.charAt(i)) {
                return Integer.compare(num1.charAt(i) - '0', num2.charAt(i) - '0');
            }
        }

        return 0;
    }

    private String swap(String num, int i, int j) {
        char[] chars = num.toCharArray();
        char temp = chars[i];
        chars[i] = chars[j];
        chars[j] = temp;

        return new String(chars);
    }

    private long getFactorial(int n) {
        long factorial = 1;
        for (int i = 2; i <= n; i++) {
            factorial *= i;
        }
        return factorial;
    }
}

