public class Solution {
    public int minFlips(String s) {
        int n = s.length();
        int res = 0;

        for (int i = 1; i < n; i++) {
            if ((s.charAt(i - 1) == '0' && s.charAt(i) == '0') || 
                (s.charAt(i - 1) == '1' && s.charAt(i) == '1')) {
                res++;
            }
        }

        int min = Math.min(res, n - res);

        for (int i = 0; i < n; i++) {
            if ((i > 0 && i < n - 1 && 
                 (s.charAt(i - 1) == s.charAt(i) || s.charAt(i) == s.charAt(i + 1))) ||
                (i == 0 && s.charAt(0) == '0' && s.charAt(1) == '0') || 
                (i == n - 1 && s.charAt(n - 2) == '0' && s.charAt(n - 1) == '0')) {
                res++;
            }
        }

        return Math.min(res, min);
    }
}

