public class Solution {
    public int[] earliestAndLatest(int n, int firstPlayer, int secondPlayer) {
        // Flip to make p1 be more closer to left than p2 to right end for convenience
        firstPlayer = Math.min(firstPlayer, n - firstPlayer + 1);
        secondPlayer = Math.min(secondPlayer, n - secondPlayer + 1);

        if (firstPlayer == secondPlayer) {
            return new int[]{0, 0};
        }

        // p2 is in the later half (and has >= p1 distance to the end)
        boolean p2InLaterHalf = firstPlayer <= secondPlayer;

        int[] dp = new int[n + 1];
        for (int i = n; i > 0; --i) {
            if (p2InLaterHalf && i == secondPlayer - firstPlayer) {
                continue;
            }
            if (firstPlayer < i && i <= secondPlayer) {
                continue;
            }

            int maxGroupSize = Math.min(i, (n + 1) / 2);
            for (int j = 0; j <= maxGroupSize; ++j) {
                dp[i] = Math.max(dp[i], Math.max(j, dp[Math.max(0, i - j)]));
            }
        }

        int earliestRound = n;
        for (int i = n; i > 0; --i) {
            if (p2InLaterHalf && i == secondPlayer - firstPlayer) {
                continue;
            }
            if (firstPlayer < i && i <= secondPlayer) {
                continue;
            }

            int maxGroupSize = Math.min(i, (n + 1) / 2);
            for (int j = 0; j <= maxGroupSize; ++j) {
                if (dp[i] == Math.max(j, dp[Math.max(0, i - j)])) {
                    earliestRound = Math.min(earliestRound, n - i + 1);
                    break;
                }
            }
        }

        int latestRound = 0;
        for (int i = n; i > 0; --i) {
            if (p2InLaterHalf && i == secondPlayer - firstPlayer) {
                continue;
            }
            if (firstPlayer < i && i <= secondPlayer) {
                continue;
            }

            int maxGroupSize = Math.min(i, (n + 1) / 2);
            for (int j = 0; j <= maxGroupSize; ++j) {
                if (dp[i] == Math.max(j, dp[Math.max(0, i - j)])) {
                    latestRound = Math.max(latestRound, n - i + 1);
                    break;
                }
            }
        }

        return new int[]{earliestRound, latestRound};
    }
}

