import java.util.Arrays;

public class Solution {
    public int rearrangeSticks(int n, int k) {
        long MOD = (long) 1e9 + 7;
        if (k == 1 || k == n) return n;
        long[] dp = new long[n + 1];
        Arrays.fill(dp, 1);
        for (int i = 2; i <= n; ++i) {
            long[] next = new long[i];
            for (int j = 0; j < i - 1; ++j) {
                next[j] = (dp[j] * j + dp[j + 1] * (i - 1 - j)) % MOD;
            }
            next[i - 1] = dp[i - 1] * (i - 1);
            for (int j = 0; j < i; ++j) {
                dp[j] = next[j];
            }
        }
        return (int) ((dp[k - 1] + dp[k]) % MOD);
    }
}

