public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        int ones = 0;
        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == '1') {
                ones++;
            }
        }

        if (Math.abs(ones - (n + 1) / 2) > 1) {
            return -1;
        }

        int swaps = 0;
        for (int i = 0; i < n; i++) {
            if ((i % 2 == 0 && s.charAt(i) != '1') || (i % 2 == 1 && s.charAt(i) != '0')) {
                swaps++;
            }
        }

        return Math.min(swaps, n - swaps);
    }
}

