public class Solution {
    public int[] closestRoom(int[][] rooms, int[][] queries) {
        Arrays.sort(rooms, (a, b) -> a[1] - b[1]);
        TreeSet<Integer> set = new TreeSet<>();
        for (int[] room : rooms) {
            set.add(room[0]);
        }

        int[] answer = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int preferred = queries[i][0];
            int minSize = queries[i][1];

            Integer ceiling = set.ceiling(preferred);
            if (ceiling != null && set.contains(ceiling)) {
                if (set.lower(ceiling) != null && set.higher(ceiling) != null) {
                    int lower = set.lower(ceiling);
                    int higher = set.higher(ceiling);

                    if (Math.abs(lower - preferred) <= Math.abs(higher - preferred)) {
                        answer[i] = lower;
                    } else {
                        answer[i] = higher;
                    }
                } else if (set.lower(ceiling) != null) {
                    answer[i] = set.lower(ceiling);
                } else if (set.higher(ceiling) != null) {
                    answer[i] = set.higher(ceiling);
                }
            }

            Integer floor = set.floor(preferred);
            if (floor != null && set.contains(floor)) {
                if (set.lower(floor) != null && set.higher(floor) != null) {
                    int lower = set.lower(floor);
                    int higher = set.higher(floor);

                    if (Math.abs(lower - preferred) <= Math.abs(higher - preferred)) {
                        answer[i] = lower;
                    } else {
                        answer[i] = higher;
                    }
                } else if (set.lower(floor) != null) {
                    answer[i] = set.lower(floor);
                } else if (set.higher(floor) != null) {
                    answer[i] = set.higher(floor);
                }
            }

            Integer ceiling2 = set.ceiling(preferred - minSize + 1);
            if (ceiling2 != null && set.contains(ceiling2)) {
                if (set.lower(ceiling2) != null && set.higher(ceiling2) != null) {
                    int lower = set.lower(ceiling2);
                    int higher = set.higher(ceiling2);

                    if (Math.abs(lower - preferred) <= Math.abs(higher - preferred)) {
                        answer[i] = lower;
                    } else {
                        answer[i] = higher;
                    }
                } else if (set.lower(ceiling2) != null) {
                    answer[i] = set.lower(ceiling2);
                } else if (set.higher(ceiling2) != null) {
                    answer[i] = set.higher(ceiling2);
                }
            }

            Integer floor2 = set.floor(preferred + minSize - 1);
            if (floor2 != null && set.contains(floor2)) {
                if (set.lower(floor2) != null && set.higher(floor2) != null) {
                    int lower = set.lower(floor2);
                    int higher = set.higher(floor2);

                    if (Math.abs(lower - preferred) <= Math.abs(higher - preferred)) {
                        answer[i] = lower;
                    } else {
                        answer[i] = higher;
                    }
                } else if (set.lower(floor2) != null) {
                    answer[i] = set.lower(floor2);
                } else if (set.higher(floor2) != null) {
                    answer[i] = set.higher(floor2);
                }
            }

            if (answer[i] == 0) {
                for (int[] room : rooms) {
                    if (room[1] >= minSize && Math.abs(room[0] - preferred) <= Math.abs(answer[i] - preferred)) {
                        answer[i] = room[0];
                        break;
                    }
                }
            }
        }

        return answer;
    }
