import java.util.Arrays;

public class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int group : groups) {
            map.put(group % batchSize, map.getOrDefault(group % batchSize, 0) + 1);
        }

        int n = map.size();
        long[][] dp = new long[n][batchSize];
        for (long[] row : dp) Arrays.fill(row, -1);

        return helper(0, map, dp, batchSize);
    }

    private int helper(int mask, Map<Integer, Integer> map, long[][] dp, int batchSize) {
        if (mask == (1 << map.size()) - 1) return 0;

        if (dp[mask][batchSize] != -1) return (int) dp[mask][batchSize];

        int max = 0;
        for (Map.Entry<Integer, Integer> entry : map.entrySet()) {
            int group = entry.getKey();
            int count = entry.getValue();

            if ((mask & (1 << entry.getKey())) == 0) {
                long temp = helper(mask | (1 << entry.getKey()), map, dp, batchSize);
                max = Math.max(max, (int) temp + count);
            }
        }

        return dp[mask][batchSize] = max;
    }
}

