public class Solution {
    public int stoneGameVIII(int[] stones) {
        int n = stones.length;
        long[] presum = new long[n + 1];
        for (int i = 0; i < n; i++) {
            presum[i + 1] = presum[i] + stones[i];
        }

        long[][] dp = new long[n][2];
        dp[0][0] = 0;
        dp[0][1] = presum[1];

        for (int i = 1; i < n; i++) {
            int j = i - 1;
            while (j > 0 && presum[j + 1] >= presum[i]) {
                j--;
            }

            if (j == 0) {
                dp[i][0] = Math.max(dp[i][0], presum[i]);
                dp[i][1] = Math.min(dp[i][1], -dp[i][0]);
            } else {
                dp[i][0] = Math.max(dp[i][0], dp[j][0] + presum[i] - presum[j]);
                dp[i][1] = Math.min(dp[i][1], dp[j][1] - (presum[i] - presum[j]));
            }
        }

        return (int) dp[n - 1][1];
    }
}

