public class Solution {
    public int maxFrequency(int[] nums, int k) {
        long sum = 0;
        int n = nums.length;
        int ans = 1;
        for (int i = 1; i < n; i++) {
            if (nums[i] == nums[i - 1]) {
                sum += nums[i];
                while (sum + k < nums[i] * (i - (i - ans))) {
                    sum -= nums[ans++];
                }
            } else {
                sum = nums[i];
                ans = i;
            }
            if (nums[i] * (i - (i - ans)) > nums[i - 1] * ((i - 1) - (i - ans))) {
                ans = i;
            }
        }
        return ans + 1;
    }
}

