        Arrays.sort(restrictions, Comparator.comparingInt(a -> a[0]));

        for (int i = 1; i < restrictions.length; i++) {
            restrictions[i][0] = Math.max(restrictions[i-1][0], restrictions[i][0]);
            restrictions[i][1] = Math.min(restrictions[i-1][1], restrictions[i][1]);
        }

        int[] heights = new int[n];
        for (int i = 0; i < n - 1; i++) {
            heights[i + 1] = Math.max(1, Math.min(n - i - 2, restrictions[Arrays.binarySearch(restrictions, new int[]{i+1, Integer.MAX_VALUE})][1]));
        }

        for (int i = n - 2; i >= 0; i--) {
            heights[i] = Math.min(heights[i], heights[i + 1] + (n - i - 1));
        }

        return heights[0];
    }
}

