public class Solution {
    public int minSkips(int[] dist, int speed, int hoursBefore) {
        int n = dist.length;
        double[][] dp = new double[n + 1][n + 1];

        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= n; j++) {
                if (i == 0) {
                    dp[i][j] = Double.POSITIVE_INFINITY;
                } else if (j == 0) {
                    double time = dist[i - 1] / speed + Math.ceil((dist[i - 1] % speed) / speed);
                    dp[i][j] = Math.max(time, hoursBefore);
                } else {
                    double time = dist[i - 1] / speed + Math.ceil((dist[i - 1] % speed) / speed);
                    if (dp[i - 1][j] <= hoursBefore && dp[i - 1][j] < time) {
                        dp[i][j] = dp[i - 1][j];
                    } else if (dp[i - 1][j - 1] <= hoursBefore && dp[i - 1][j - 1] + dist[i - 1] / speed < time) {
                        dp[i][j] = Math.min(dp[i][j], dp[i - 1][j - 1] + dist[i - 1] / speed);
                    } else if (dp[i - 1][0] <= hoursBefore && dp[i - 1][0] + dist[i - 1] / speed < time) {
                        dp[i][j] = Math.min(dp[i][j], dp[i - 1][0] + dist[i - 1] / speed);
                    } else {
                        dp[i][j] = Double.POSITIVE_INFINITY;
                    }
                }
            }
        }

        int ans = (int) (dp[n][n] == Double.POSITIVE_INFINITY ? -1 : Math.ceil(dp[n][n]));
        return ans;
    }
}

