public class Solution {
    public int countPairs(int[] nums, int low, int high) {
        Map<Integer, Integer> freqMap = new HashMap<>();
        for (int num : nums) {
            freqMap.put(num, freqMap.getOrDefault(num, 0) + 1);
        }

        long res = 0;
        for (int count : freqMap.values()) {
            int xorCount = count * (count - 1) / 2;

            if (low <= 0) {
                res += (long) xorCount * count;
            } else {
                int maxXor = Math.min(high, (int) ((freqMap.getOrDefault(0, 0) + 1) * count));
                int minXor = Math.max(low, (int) ((freqMap.getOrDefault(0, 0) - 1) * count));

                if (maxXor > minXor) {
                    res += (long) maxXor * count;
                }
            }
        }

        return (int) res;
    }
}

