public class Solution {
    public int minAbsoluteSumDiff(int[] nums1, int[] nums2) {
        long mod = (long) 1e9 + 7;
        int n = nums1.length;
        long sum = 0;
        TreeSet<Integer> set = new TreeSet<>();

        for (int i = 0; i < n; i++) {
            set.add(nums1[i]);
            sum += Math.abs(nums1[i] - nums2[i]) % mod;
        }

        int minDiff = (int) (sum % mod);
        long maxDiff = 0;

        for (int i = 0; i < n; i++) {
            if (set.contains(nums2[i])) {
                continue;
            }

            int diff = sum - Math.abs(nums1[i] - nums2[i]) % mod;
            int ceil = set.ceiling(nums2[i]);
            int floor = set.floor(nums2[i]);

            maxDiff = Math.max(maxDiff, (long) (diff + Math.abs(ceil - nums2[i])) % mod);
            maxDiff = Math.max(maxDiff, (long) (diff + Math.abs(floor - nums2[i])) % mod);
        }

        return (int) ((maxDiff == 0 ? minDiff : maxDiff) % mod);
    }
}

