public class Solution {
    public int minWastedSpace(int[] packages, int[][] boxes) {
        Arrays.sort(packages);
        long totalPackages = 0;
        for (int packageSize : packages) {
            totalPackages += packageSize;
        }

        long minWaste = Long.MAX_VALUE;
        for (int[] boxSizes : boxes) {
            Arrays.sort(boxSizes);

            int prev = -1, upper = 0;
            long waste = 0;
            for (int boxSize : boxSizes) {
                while (upper < packages.length && packages[upper] <= boxSize) {
                    prev = upper++;
                }

                if (prev == -1 || packages[prev] > boxSize) continue;

                int lower = prev;
                long count = 0, sum = 0;
                for (int i = lower; i < upper; i++) {
                    count += packages[i];
                    sum += packages[i] * (i - lower + 1);
                }

                if (count == totalPackages) {
                    waste = boxSize * (upper - prev) - sum;
                    break;
                } else if (count > totalPackages) continue;

                long tempWaste = Long.MAX_VALUE;
                for (int i = lower; i < upper; i++) {
                    int j = Math.min(i, packages.length - 1);
                    while (j >= i && packages[j] <= boxSize) {
                        if (count + (j - i + 1) == totalPackages) {
                            tempWaste = Math.min(tempWaste, boxSize * (j - i + 1) - sum - (packages[j] * (j - i)));
                            break;
                        } else if (count + (j - i + 1) > totalPackages) {
                            j--;
                        }
                    }
                }

                waste = Math.min(waste, tempWaste);
            }

            if (waste != Long.MAX_VALUE && minWaste > waste % (int)(Math.pow(10, 9) + 7)) {
                minWaste = waste % (int)(Math.pow(10, 9) + 7);
            }
        }

        return minWaste == Long.MAX_VALUE ? -1 : (int)minWaste;
    }
}

