public class Solution {
    public int subsetXORSum(int[] nums) {
        return helper(nums, 0);
    }

    private int helper(int[] nums, int currentXor) {
        if (nums.length == 0) {
            return currentXor;
        }
        int include = helper(getExclude(nums), currentXor ^ nums[0]);
        int exclude = helper(getExclude(nums), currentXor);
        return include + exclude;
    }

    private int[] getExclude(int[] nums) {
        int[] result = new int[nums.length - 1];
        System.arraycopy(nums, 1, result, 0, nums.length - 1);
        return result;
    }
}

