public class Solution {
    public int[] assignTasks(int[] servers, int[] tasks) {
        Queue<Server> availableServers = new PriorityQueue<>();
        for (int i = 0; i < servers.length; i++) {
            availableServers.offer(new Server(i, servers[i]));
        }
        Queue<Task> taskQueue = new PriorityQueue<>();
        int time = 0;
        int[] ans = new int[tasks.length];
        for (int i = 0; i < tasks.length; i++) {
            while (!availableServers.isEmpty() && !taskQueue.isEmpty()) {
                if (time >= taskQueue.peek().start) {
                    Task t = taskQueue.poll();
                    Server s = availableServers.poll();
                    ans[t.index] = s.id;
                    time += t.time;
                    s.assignedTime = time;
                    availableServers.offer(s);
                } else {
                    break;
                }
            }
            if (!availableServers.isEmpty()) {
                Server s = availableServers.poll();
                taskQueue.offer(new Task(i, time + tasks[i], s));
            } else {
                time = taskQueue.peek().start;
            }
        }
        while (!taskQueue.isEmpty()) {
            Task t = taskQueue.poll();
            Server s = availableServers.poll();
            ans[t.index] = s.id;
            time += t.time;
            s.assignedTime = time;
            availableServers.offer(s);
        }
        return ans;
    }

    private static class Server implements Comparable<Server> {
        int id, weight, assignedTime;

        public Server(int id, int weight) {
            this.id = id;
            this.weight = weight;
        }

        @Override
        public int compareTo(Server other) {
            if (weight == other.weight) {
                return Integer.compare(id, other.id);
            }
            return Integer.compare(weight, other.weight);
        }
    }

    private static class Task implements Comparable<Task> {
        int index, start, time;

        public Task(int index, int start, Server server) {
            this.index = index;
            this.start = start;
            this.time = tasks[index];
        }

        @Override
        public int compareTo(Task other) {
            return Integer.compare(start, other.start);
        }
    }
}

