    private long dfs(int n, long[] dp) {
        if (n == 0) return 1;
        if (dp[n] != -1) return dp[n];
        for (int i = 3; i <= n / i; i += 2) {
            if (n % i == 0) {
                dp[n] = (dp[n] + dfs(n / i, dp) * dfs(i, dp)) % MOD;
                break;
            }
        }
        return dp[n];
    }

