public class Solution {
    public int minSideJumps(int[] obstacles) {
        int n = obstacles.length;
        int[][] dp = new int[n][3];

        for (int i = 0; i < n - 1; i++) {
            if (obstacles[i + 1] == 2 && obstacles[i] != 2) {
                dp[i + 1][0] = Math.min(dp[i][1], dp[i][2]) + 1;
                dp[i + 1][1] = Integer.MAX_VALUE / 2;
                dp[i + 1][2] = Math.min(dp[i][0], dp[i][1]) + 1;
            } else if (obstacles[i + 1] == 1 && obstacles[i] != 1) {
                dp[i + 1][0] = Math.min(dp[i][0], dp[i][2]);
                dp[i + 1][1] = Math.min(dp[i][0], dp[i][2]) + 1;
                dp[i + 1][2] = Math.min(dp[i][1], dp[i][2]) + 1;
            } else if (obstacles[i + 1] == 3 && obstacles[i] != 3) {
                dp[i + 1][0] = Math.min(dp[i][0], dp[i][1]);
                dp[i + 1][1] = Math.min(dp[i][0], dp[i][2]) + 1;
                dp[i + 1][2] = Math.min(dp[i][1], dp[i][2]) + 1;
            } else {
                for (int j = 0; j < 3; j++) {
                    if (obstacles[i + 1] != j) {
                        dp[i + 1][j] = Math.min(dp[i][0], dp[i][1], dp[i][2]);
                    }
                }
            }
        }

        int min = Integer.MAX_VALUE / 2;
        for (int i = 0; i < 3; i++) {
            if (obstacles[n - 1] != i) {
                min = Math.min(min, dp[n - 1][i]);
            }
        }

        return min;
    }
}

