import java.util.ArrayDeque;
import java.util.Deque;

public class Solution {
    public int scoreOfParentheses(String s) {
        Deque<Integer> stack = new ArrayDeque<>();
        stack.push(0);
        for (char c : s.toCharArray()) {
            if (c == '(') {
                stack.push(0);
            } else if (c == ')') {
                int top = stack.pop();
                int sum = 2 * top;
                if (!stack.isEmpty() && stack.peek() > sum) {
                    stack.set(stack.indexOf(top), sum);
                }
            }
        }
        int result = 0;
        while (!stack.isEmpty()) {
            result += stack.pop();
        }
        return result;
    }
}

