import java.util.LinkedList;
import java.util.Queue;

public class Solution {
    public int shortestPathAllKeys(String[] stringGrid) {
        int m = stringGrid.length, n = stringGrid[0].length();
        char[][] grid = new char[m][n];
        for (int i = 0; i < m; i++) {
            grid[i] = stringGrid[i].toCharArray();
        }
        int startX = -1, startY = -1;
        int numKeys = 0;
        boolean[] keys = new boolean[26];

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == '@') {
                    startX = i;
                    startY = j;
                } else if ('a' <= grid[i][j] && grid[i][j] <= 'f') {
                    keys[grid[i][j] - 'a'] = true;
                    numKeys++;
                }
            }
        }

        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        Queue<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[m][n];
        queue.offer(new int[]{startX, startY, 0});
        visited[startX][startY] = true;

        int ans = Integer.MAX_VALUE;
        while (!queue.isEmpty()) {
            int[] cur = queue.poll();
            if (cur[2] >= ans) continue;
            for (int[] dir : directions) {
                int x = cur[0] + dir[0], y = cur[1] + dir[1];
                if (x < 0 || x >= m || y < 0 || y >= n || grid[x][y] == '#' || visited[x][y]) continue;
                visited[x][y] = true;

                int newKeys = 0;
                for (int i = 0; i < numKeys; i++) {
                    if (!keys[i] && ((cur[2] >> i) & 1) != 0) {
                        newKeys++;
                    }
                }

                if (newKeys == numKeys) {
                    ans = Math.min(ans, cur[2]);
                    continue;
                }

                int newState = cur[2];
                for (int i = 0; i < numKeys; i++) {
                    if (!keys[i] && grid[x][y] == ((char) ('a' + i))) {
                        newState |= (1 << i);
                    } else if (keys[i] && grid[x][y] == ((char) ('A' + i)) && ((cur[2] >> i) & 1) != 0) {
                        newState |= (1 << i);
                    }
                }

                queue.offer(new int[]{x, y, newState});
            }
        }

        return ans == Integer.MAX_VALUE ? -1 : ans;
    }
}

