import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Integer> splitIntoFibonacci(String num) {
        int n = num.length();
        for (int i = 1; i <= Math.min(10, n); i++) {
            if (n % i == 0 && num.charAt(0) == '0') continue;
            if (!num.substring(0, i).equals("0")) {
                List<Integer> res = new ArrayList<>();
                int cur = Integer.parseInt(num.substring(0, i));
                res.add(cur);
                splitIntoFibonacciHelper(num, i, res, 1, cur);
                return res;
            }
        }
        return new ArrayList<>();
    }

    private boolean splitIntoFibonacciHelper(String num, int start, List<Integer> res, int index, long prev) {
        if (index >= res.size()) return false;
        long cur = Long.parseLong(num.substring(start));
        if (cur > Integer.MAX_VALUE || cur < 0) return false;
        if (cur == 0 && index + 1 != res.size()) return false;
        if (prev > Integer.MAX_VALUE - cur || prev < 0) return false;
        long sum = prev + cur;
        for (int i = index; i < res.size(); i++) {
            if (sum / res.get(i) != sum / (long)res.get(i)) break;
            if (i == index && sum == res.get(i)) continue;
            if (i > index && res.get(i) > (int)(sum % 1000000000L)) return false;
            if (i == res.size() - 1 || i < res.size() - 1 && res.get(i + 1) > (int)(sum % 1000000000L)) {
                res.add((int)cur);
                if (!splitIntoFibonacciHelper(num, start + Integer.toString(cur).length(), res, index + 1, sum)) {
                    res.remove(res.size() - 1);
                    return false;
                }
                return true;
            }
        }
        return false;
    }
}

