public class Solution {
    public boolean splitArraySameAverage(int[] nums) {
        int n = nums.length;
        long sum = 0;
        for (int num : nums) {
            sum += num;
        }

        if (sum % n != 0) return false;

        Arrays.sort(nums);
        for (int i = 1; i < n; i++) {
            if ((nums[i - 1] * (n - i)) % (sum / n) == 0) {
                return true;
            }
        }

        for (int i = 2; i <= n / 2; i++) {
            long[] dp = new long[n + 1];
            boolean found = false;
            for (int j = i; j < n; j++) {
                if ((nums[j] * i) % (sum / i) == 0) {
                    dp[j - i + 1] |= dp[j - i];
                    if ((dp[j - i + 1] & (1L << (j - i))) != 0) {
                        found = true;
                    }
                }
            }
            if (found) return true;
        }

        return false;
    }
}

