public class Solution {
    public int[] loudAndRich(int[][] richer, int[] quiet) {
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 0; i < rich.length; i++) {
            if (!graph.containsKey(rich[i][1])) {
                graph.put(rich[i][1], new ArrayList<>());
            }
            graph.get(rich[i][1]).add(rich[i][0]);
        }

        int[] answer = new int[people];
        Arrays.fill(answer, -1);

        for (int i = 0; i < people; i++) {
            if (!graph.containsKey(i)) {
                dfs(graph, quiet, answer, i);
            }
        }

        return answer;
    }

    private void dfs(Map<Integer, List<Integer>> graph, int[] quiet, int[] answer, int person) {
        if (answer[person] != -1) {
            return;
        }

        int minQuiet = Integer.MAX_VALUE;
        int minPerson = -1;

        for (int neighbor : graph.getOrDefault(person, new ArrayList<>())) {
            dfs(graph, quiet, answer, neighbor);
            if (quiet[neighbor] < minQuiet) {
                minQuiet = quiet[neighbor];
                minPerson = neighbor;
            }
        }

        answer[person] = minPerson;
    }

    private int people;

    public Solution() {
        for (int[] rich : richer) {
            people = Math.max(people, Math.max(rich[0], rich[1]));
        }
    }
}

