public class Solution {
    public int superEggDrop(int k, int n) {
        int[][] dp = new int[k + 1][n + 1];

        for (int i = 1; i <= k; i++) {
            for (int j = 1; j <= n; j++) {
                if (j == 1) {
                    dp[i][j] = 1;
                } else if (i == 1) {
                    dp[i][j] = j;
                } else {
                    int low = 1, high = j;
                    while (low < high) {
                        int mid = (low + high) / 2;
                        if (dp[i - 1][mid - 1] < dp[i][j - mid]) {
                            low = mid + 1;
                        } else {
                            high = mid;
                        }
                    }
                    dp[i][j] = Math.max(dp[i - 1][low - 1], dp[i][j - low]) + 1;
                }
            }
        }

        return dp[k][n];
    }
}

