public class Solution {
    public double largestSumOfAverages(int[] nums, int k) {
        int n = nums.length;
        long[][] dp = new long[n + 1][k + 1];

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= Math.min(i, k); j++) {
                if (j == 1) {
                    dp[i][j] = nums[i - 1];
                } else {
                    long sum = 0;
                    for (int p = i - 1; p >= j - 1; p--) {
                        sum += nums[p];
                        dp[i][j] = Math.max(dp[i][j], dp[p][j - 1] + (sum * 1.0) / (i - p));
                    }
                }
            }
        }

        return dp[n][k] * 1.0 / n;
    }
}

