public class Solution {
    public int racecar(int target) {
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{0, 0});
        boolean[] visited = new boolean[200001];
        visited[0] = true;
        int step = 1;
        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                int[] curr = queue.poll();
                if (curr[0] == target) return step;
                int pos = curr[0];
                int speed = curr[1];
                if (speed > 0) {
                    if (!visited[pos + speed * 2]) {
                        visited[pos + speed * 2] = true;
                        queue.offer(new int[]{pos + speed * 2, Math.max(speed * 2, -1)});
                    }
                    if (!visited[pos + speed]) {
                        visited[pos + speed] = true;
                        queue.offer(new int[]{pos + speed, -speed});
                    }
                } else {
                    if (!visited[pos + speed * 2]) {
                        visited[pos + speed * 2] = true;
                        queue.offer(new int[]{pos + speed * 2, Math.min(speed * 2, 1)});
                    }
                    if (!visited[pos + speed]) {
                        visited[pos + speed] = true;
                        queue.offer(new int[]{pos + speed, -speed});
                    }
                }
            }
            step++;
        }
        return -1;
    }
}

