import com_github_leetcode.TreeNode;

public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        return buildTree(preorder, 0, preorder.length - 1, postorder, 0, postorder.length - 1);
    }

    private TreeNode buildTree(int[] preorder, int preStart, int preEnd, int[] postorder, int postStart, int postEnd) {
        if (preStart > preEnd || postStart > postEnd) return null;

        TreeNode root = new TreeNode(preorder[preStart]);
        if (preStart == preEnd) return root;

        int index = findIndex(postorder, preorder[preStart + 1]);

        root.left = buildTree(preorder, preStart + 1, preStart + 1 + index - postStart, postorder, postStart, postStart + index - 1);
        root.right = buildTree(preorder, preStart + 1 + index - postStart, preEnd, postorder, postStart + index, postEnd - 1);

        return root;
    }

    private int findIndex(int[] arr, int target) {
        for (int i = 0; i < arr.length; i++) {
            if (arr[i] == target) return i;
        }
        return -1;
    }
}

