        int count = 0;
        double cost = 0;
        for (int i = workers.length - 1; i >= 0 && k > 0; i--) {
            Worker worker = workers[i];
            if (count < k) {
                pq.offer(worker);
                count++;
                cost += Math.max((double) worker.wage, worker.ratio * worker.quality);
            } else {
                double minCost = Double.POSITIVE_INFINITY;
                while (!pq.isEmpty() && minCost > pq.peek().ratio * pq.peek().quality) {
                    Worker tempWorker = pq.poll();
                    double newCost = cost - (tempWorker.ratio * tempWorker.quality / totalQuality) * Math.max((double) tempWorker.wage, tempWorker.ratio * tempWorker.quality);
                    newCost += Math.max((double) worker.wage, worker.ratio * worker.quality);
                    minCost = Math.min(minCost, newCost);
                }
                cost = minCost;
            }
        }

        return cost;
    }

    private static class Worker {
        int quality;
        int wage;

        public Worker(int quality, int wage) {
            this.quality = quality;
            this.wage = wage;
            this.ratio = (double) quality / wage;
        }

        double ratio;
    }
}

package referenz;

import java.util.*;

public class Solution {
    public int shortestPathLength(int[][] graph) {
        int n = graph.length;
        boolean[] visited = new boolean[n];
        Queue<int[]> queue = new ArrayDeque<>();

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                queue.offer(new int[]{i, 1 << i});
                visited[i] = true;
            }
        }

        Set<String> seen = new HashSet<>();

        while (!queue.isEmpty()) {
            int[] node = queue.poll();
            int mask = node[1];
            int currNode = node[0];

            if (mask == (1 << n) - 1) return node[1] - 1;

            for (int neighbor : graph[currNode]) {
                String key = currNode + "," + (mask | (1 << neighbor));
                if (!seen.contains(key)) {
                    queue.offer(new int[]{neighbor, mask | (1 << neighbor)});
                    seen.add(key);
                }
            }
        }

        return -1;
    }
}

