import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int sumSubseqWidths(int[] nums) {
        Arrays.sort(nums);
        long mod = (long) 1e9 + 7;
        Map<Integer, Long> map = new HashMap<>();
        for (int i : nums) {
            map.put(i, map.getOrDefault(i, 0L) + 1);
        }
        long ans = 0;
        for (int i = 0; i < nums.length; i++) {
            int num = nums[i];
            long count = map.get(num);
            long left = 0;
            long right = 0;
            for (int j = 0; j <= i; j++) {
                if (map.containsKey(nums[j])) {
                    left += (long) map.get(nums[j]) * pow(2, i - j, mod);
                }
            }
            for (int j = i + 1; j < nums.length; j++) {
                if (map.containsKey(nums[j])) {
                    right += (long) map.get(nums[j]) * pow(2, j - i - 1, mod);
                }
            }
            ans = (ans + count * left % mod * right % mod) % mod;
        }
        return (int) (ans % mod);
    }

    private long pow(long a, long b, long mod) {
        if (b == 0) return 1;
        long res = pow(a, b / 2, mod);
        if (b % 2 == 1) {
            return (((res * res) % mod) * a) % mod;
        } else {
            return ((res * res) % mod);
        }
    }
}

package referenz;


import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<TreeNode> allPossibleFBT(int n) {
        if (n % 2 == 0) return new ArrayList<>();
        if (n == 1) return List.of(new TreeNode(0));

        List<TreeNode> result = new ArrayList<>();
        for (int i = 1; i < n; i += 2) {
            List<TreeNode> leftTrees = allPossibleFBT(i);
            List<TreeNode> rightTrees = allPossibleFBT(n - i - 1);

            for (TreeNode left : leftTrees) {
                for (TreeNode right : rightTrees) {
                    TreeNode root = new TreeNode(0);
                    root.left = left;
                    root.right = right;
                    result.add(root);
                }
            }
        }

        return result;
    }
}

