import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int numFactoredBinaryTrees(int[] arr) {
        Arrays.sort(arr);
        Map<Integer, Integer> dp = new HashMap<>();
        long mod = (long) 1e9 + 7;
        for (int i = 0; i < arr.length; i++) {
            dp.put(arr[i], 1);
            int left = 0;
            int right = i - 1;
            while (left <= right) {
                if (arr[left] * arr[right] == arr[i]) {
                    dp.put(arr[i], (int) ((dp.getOrDefault(arr[left], 0) * dp.getOrDefault(arr[right], 0)) % mod));
                    left++;
                    right--;
                } else if (arr[left] * arr[right] < arr[i]) {
                    left++;
                } else {
                    right--;
                }
            }
        }
        int res = 0;
        for (int value : dp.values()) {
            res += value;
        }
        return (int) (res % mod);
    }
}

package referenz;


public class Solution {
    public int numFriendRequests(int[] ages) {
        int n = ages.length;
        int[] count = new int[101];

        for (int age : ages) {
            count[age]++;
        }

        long res = 0;

        for (int i = 1; i <= 100; i++) {
            if (i > 100 && count[i] == 0) continue;

            int j = i;
            while (j <= 100) {
                res += (long)count[j] * (count[i] - (j != i ? 1 : 0));

                if (j < 100 || i / 2 >= j) break;

                j++;
            }
        }

        return (int)res;
    }
}

