import java.util.*;

public class Solution {
    public boolean canVisitAllRooms(List<List<Integer>> rooms) {
        Set<Integer> visited = new HashSet<>();
        dfs(rooms, 0, visited);
        return visited.size() == rooms.size();
    }

    private void dfs(List<List<Integer>> rooms, int room, Set<Integer> visited) {
        if (visited.contains(room)) return;
        visited.add(room);
        for (int key : rooms.get(room)) {
            dfs(rooms, key, visited);
        }
    }
}

package referenz;


import java.util.*;

public class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        // Build graph
        Map<Integer, List<int[]>> graph = new HashMap<>();
        for (int i = 0; i < n; i++) {
            graph.put(i, new ArrayList<>());
        }
        for (int[] edge : edges) {
            graph.get(edge[0]).add(new int[]{edge[1], edge[2]});
            graph.get(edge[1]).add(new int[]{edge[0], edge[2]});
        }

        // Do dijkstra
        Queue<int[]> queue = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        boolean[] visited = new boolean[n];
        int[] dist = new int[n];
        Arrays.fill(dist, Integer.MAX_VALUE);
        dist[0] = 0;
        queue.offer(new int[]{0, 0});
        while (!queue.isEmpty()) {
            int[] node = queue.poll();
            if (visited[node[0]]) continue;
            visited[node[0]] = true;
            for (int[] neighbor : graph.get(node[0])) {
                if (neighbor[1] > 0) {
                    int newDist = dist[node[0]] + 1;
                    if (newDist <= maxMoves && !visited[neighbor[0]]) {
                        queue.offer(new int[]{neighbor[0], newDist});
                        dist[neighbor[0]] = Math.min(dist[neighbor[0]], newDist);
                    }
                }
            }
        }

        // Count reachable nodes
        int count = 0;
        for (int i = 0; i < n; i++) {
            if (visited[i]) count++;
            for (int[] edge : graph.get(i)) {
                if (edge[1] > 0) {
                    int l = Math.max(0, maxMoves - dist[i]);
                    int r = Math.min(edge[1], maxMoves - dist[i]);
                    count += r - l + 1;
                }
            }
        }

        return count;
    }
}
